function CreateGrammarPage() {
  const classes = useStyle();

  return (
    <div className="container">
      <div className={classes.root}>
        <div className="ani-fade">
          <CreateGrammarData />
        </div>
      </div>
    </div>
  );
}

export default CreateGrammarPage;
